--
-- Table structure for table `bahan_baku_klien`
--

DROP TABLE IF EXISTS `bahan_baku_klien`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `bahan_baku_klien` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT,
  `klien_id` bigint unsigned DEFAULT NULL,
  `nama` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `satuan` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `spesifikasi` text COLLATE utf8mb4_unicode_ci,
  `harga_approved` decimal(15,2) DEFAULT NULL COMMENT 'Client approved price per unit',
  `approved_at` timestamp NULL DEFAULT NULL COMMENT 'When price was approved',
  `approved_by_marketing` bigint unsigned DEFAULT NULL,
  `status` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `post` tinyint(1) NOT NULL DEFAULT '0' COMMENT 'Post checkmark status',
  `present` enum('NotUsed','Ready','Not Reasonable Price','Pos Closed','Not Qualified Raw','Not Updated Yet','Didnt Have Supplier','Factory No Need Yet','Confirmed','Sample Sent','Hold','Negotiate') COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'NotUsed' COMMENT 'Present status dropdown',
  `cause` text COLLATE utf8mb4_unicode_ci COMMENT 'Note explaining Present status',
  `jenis` json DEFAULT NULL COMMENT 'Category tags: Aqua, Poultry, Ruminansia (can have multiple)',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `deleted_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `idx_bahan_baku_klien_klien` (`klien_id`),
  KEY `idx_klien_status` (`klien_id`,`status`),
  KEY `idx_approved_by` (`approved_by_marketing`),
  CONSTRAINT `bahan_baku_klien_approved_by_marketing_foreign` FOREIGN KEY (`approved_by_marketing`) REFERENCES `users` (`id`) ON DELETE SET NULL,
  CONSTRAINT `bahan_baku_klien_klien_id_foreign` FOREIGN KEY (`klien_id`) REFERENCES `kliens` (`id`) ON DELETE RESTRICT
) ENGINE=InnoDB AUTO_INCREMENT=1025 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

